CREATE DATABASE IF NOT EXISTS question_3;
USE question_3;

CREATE TABLE IF NOT EXISTS `teachers` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`name` VARCHAR(255) NOT NULL ,
	`email` VARCHAR(255) NOT NULL UNIQUE,
     `phone` VARCHAR(15) NOT NULL,
	 `office` VARCHAR(50) NOT NULL,
	PRIMARY KEY (`id`)
)ENGINE=InnoDB;

CREATE TABLE IF NOT EXISTS `classes` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
    `courseCode` VARCHAR(15) NOT NULL,
    `dayOfWeek` VARCHAR(10) NOT NULL,
	`timeStart` VARCHAR(10) NOT NULL,
	`timeEnd` VARCHAR(10) NOT NULL,
	`teacher_id` INT(11) NOT NULL,
	PRIMARY KEY (`id`),
	CONSTRAINT teacher_class_fk FOREIGN KEY (teacher_id) REFERENCES teachers(id)
)
ENGINE=InnoDB;


SELECT
t.name AS 'Teacher', c.courseCode , c.dayOfWeek AS 'Day', c.timeStart AS 'Start', c.timeEnd AS 'end'
FROM `teachers` AS t
LEFT JOIN  classes AS c
	ON t.id = c.teacher_id
WHERE t.id = 1

